import React from 'react';
import './style.css';
import GameCard from './GameCard';

function Game(props) {
    return (
        <div className="container">
            <div className="row">
                {props.fruits.map(fruit => (
                    <GameCard 
                        key={fruit.id}
                        name={fruit.name}
                        image={fruit.image}
                        shuffle={props.shuffle}
                    />
                ))}
            </div>
        </div>
    );
};

export default Game;
